import { BrowserRouter as Router, Routes, Route, Link} from 'react-router-dom';
import '../css/pdf.css'
import Template from "../Elementos/TemplateComic"


function Batmanquerie6(){
    return(
        <div>
            <Template LinkComics="" titul/>
            {template("https://drive.google.com/file/d/11jFQp5xhHG-IIe8ONM11wJNAqXUSXNlr/preview", "El Batman que ríe #6")}
        </div>
    )
}

